&gt; Tucson does his best to reply to Talon without sounding as if he had
&gt; suffered some sort of emotional breakdown.  Breathing hard, he sends her a
&gt; reply.
&gt;
&gt;  &quot; I&#39;m here, Talon, I haven&#39;t gone anywhere.  When you return I will be
&gt; right here waiting for you.&quot;
&gt;
&gt; And I promise you this,   I will never leave your side.&quot;

&lt;NEW&gt;

As TUSCON and TALON talked LEO PRIME sent a quiet message to LORD
ELDER, &quot;Take the shuttle and go pick up Talon and the Fuzors. We can&#39;t
leave them out there too long.&quot;

After recieving an affirmation from ELDER then LEO turned back to look
at TUSCON, his optics still having that note of concern, but not
nearly so much anger. &quot;I am not assigned to remove you but to observe
you and your command style.&quot;

There was a grimace from LEO, &quot;Optimus Primal has been lost for some
time, and then Rodimus went dark, and now you have come into the
picture.&quot; LEO pulled out a PADD, &quot;We are well aware of your nature and
there are some on the council he wanted to revoke your status and
others who thought you would be a good fit.&quot;

&quot;I was sent here to determine just who was right and to take your
place should you prove unfit.&quot; LEO Looked up from his PADD to observe
TUSCON again. &quot;I have no interest in this command here, but will do so
if I have to.&quot;

Setting the PADD down LEO continued, &quot;If you want to retain your
command you will have to get your beast form under control. Your
people need you to set the pace and to establish the boundaries. They
will be looking to you for all these things. If you jukmp to a
comclusion, so will they - if you show patience and wisdom, they might
as well.&quot;

LEO PRIME smiled, &quot;In some cultures Dragon was known for wisdom and
strength as well as agression and their territorial natures. Work on
more on the first two and you will be well on your way.&quot;

